app.controller("reportesCtrl",["$scope","$routeParams","servicioHome","servicioCategoria","servicioReportes","servicioCookies","servicioAutores","servicioFacebook",function($scope,$routeParams,servicioHome,servicioCategoria,servicioReportes,servicioCookies,servicioAutores,servicioFacebook){
  init();
  $scope.cambiarValor = function(){
    console.log($scope.artistaSeleccionado);
  }
  function init(){
    $scope.mostrarFechas = false;
    $scope.usuarioArtista=false;
    $scope.usuarioAdmin=false;
    $scope.fecha = {};
    $scope.artistaSeleccionado={};
    //traer temas
    servicioCategoria.traerCategorias().query().$promise.then((datos)=>{
      $scope.listaTemas = datos;
    });
    //traer artistas
    servicioAutores.traerAutores().query().$promise.then((datos)=>{
      $scope.listaArtistas = datos;
      console.log(datos);
    },
    (err)=>{
      console.log(err);
    });
    $scope.listaArtistas
    if(servicioCookies.validarSiEstaAutenticado())
    {
      $scope.usuario = servicioCookies.traerUsuarioAutenticado();
      if($scope.usuario.tipo=="Artista")
      {
        // usuario artista
        servicioAutores.traerEstampasAutor($scope.usuario.userId).query().$promise.then((datos)=>{
          $scope.listaEstampas = datos;
        });
         $scope.usuarioArtista=true;
      }
      else
      {
         $scope.usuarioAdmin=true;
         servicioHome.traerEstampas().query().$promise.then((datos)=>{
           $scope.listaEstampas = datos;
         });
      }
    }
  }

  $scope.mostrarCampos = function (parametro){
    if(parametro=='fechas')
    {
        $scope.fechas=true;
        $scope.temas = false;
        $scope.estampa = false;
        $scope.artista = false;
        $scope.camiseta = false;
    }
    else if(parametro=='temas')
    {
      $scope.fechas=false;
      $scope.temas = true;
      $scope.estampa = false;
      $scope.artista = false;
      $scope.camiseta = false;
    }
    else if(parametro=='estampa')
    {
      $scope.fechas=false;
      $scope.temas = false;
      $scope.estampa = true;
      $scope.artista = false;
      $scope.camiseta = false;
    }
    else if(parametro=='artista')
    {
      $scope.fechas=false;
      $scope.temas = false;
      $scope.estampa = false;
      $scope.artista = true;
      $scope.camiseta = false;
    }
    else
    {
      $scope.fechas=false;
      $scope.temas = false;
      $scope.estampa = false;
      $scope.artista = false;
      $scope.camiseta = true;
    }

  }

  $scope.generarReporte = function (tipoReporte){
    switch (tipoReporte) {
      case 'fecha':
      if($scope.usuario.tipo=="Artista")
      {
        console.log($scope.fecha.inicial);
        let inicial = $scope.fecha.inicial.toISOString().substring(0,10);
        let final = $scope.fecha.final.toISOString().substring(0,10);

        servicioReportes.reportePorFechas($scope.usuario.userId,inicial,final).query().$promise.then((datos)=>{
          $scope.tablaReportes = datos;
          $scope.tablaBasica = true;
          $scope.tablaArtista=false;
          $scope.tablaCamiseta = false;
          $scope.titulos = Object.keys($scope.tablaReportes[0]);
          console.log($scope.titulos);
          $scope.cuerpo = new Array();
          angular.forEach($scope.tablaReportes,function(valor,llave){
            $scope.cuerpo.push(Object.values(valor));
          });
          crearPDF();
        })
      }
      else
      {
        console.log($scope.fecha.inicial);
        let inicial = $scope.fecha.inicial.toISOString().substring(0,10);
        let final = $scope.fecha.final.toISOString().substring(0,10);

        servicioReportes.reportePorFechas($scope.artistaSeleccionadoAdmin.userId,inicial,final).query().$promise.then((datos)=>{
          $scope.tablaReportes = datos;
          $scope.tablaBasica = true;
          $scope.tablaArtista=false;
          $scope.tablaCamiseta = false;
          $scope.titulos = Object.keys($scope.tablaReportes[0]);
          console.log($scope.titulos);
          $scope.cuerpo = new Array();
          angular.forEach($scope.tablaReportes,function(valor,llave){
            $scope.cuerpo.push(Object.values(valor));
          });
          crearPDF();
        })
      }
        break;
      case 'tema':
        console.log($scope.temaSeleccionado);
        servicioReportes.reportePorTemas($scope.artistaSeleccionadoAdmin.userId,$scope.temaSeleccionado.themeId).query().$promise.then((datos)=>{
          $scope.tablaReportes = datos;
          $scope.tablaBasica = true;
          $scope.tablaArtista=false;
          $scope.tablaCamiseta = false;
          $scope.titulos = Object.keys($scope.tablaReportes[0]);
          console.log($scope.titulos);
          $scope.cuerpo = new Array();
          angular.forEach($scope.tablaReportes,function(valor,llave){
            $scope.cuerpo.push(Object.values(valor));
          });
          crearPDF();
        });
        break;
      case 'estampa':
      //todas las estampas vendidas
      // del artista que consulta
        servicioReportes.reportePorEstampas($scope.usuario.userId).query().$promise.then((datos)=>{
          $scope.tablaReportes = datos;
          $scope.tablaBasica = true;
          $scope.tablaArtista=false;
          $scope.tablaCamiseta = false;
          $scope.titulos = Object.keys($scope.tablaReportes[0]);
          console.log($scope.titulos);
          $scope.cuerpo = new Array();
          angular.forEach($scope.tablaReportes,function(valor,llave){
            $scope.cuerpo.push(Object.values(valor));
          });
          crearPDF();
        },
        (err)=>{
          console.log(err);
        });
        break;
      case 'artista':
        console.log($scope.artistaSeleccionado);
        servicioReportes.reportePorEstampas($scope.artistaSeleccionado.userId).query().$promise.then((datos)=>{
          $scope.tablaReportes = datos;
          $scope.tablaBasica = true;
          $scope.tablaArtista=false;
          $scope.tablaCamiseta = false;
          $scope.titulos = Object.keys($scope.tablaReportes[0]);
          console.log($scope.titulos);
          $scope.cuerpo = new Array();
          angular.forEach($scope.tablaReportes,function(valor,llave){
            $scope.cuerpo.push(Object.values(valor));
          });
          crearPDF();
          },
          (err)=>{
            console.log(err);
          });
        break;
      case 'camiseta':
        servicioReportes.reportePorCamiseta().query().$promise.then((datos)=>{
          $scope.tablaReportes = datos;
          $scope.tablaArtista=false;
          $scope.tablaCamiseta = true;
          $scope.tablaBasica = false;
          $scope.titulos = Object.keys($scope.tablaReportes[0]);
          console.log($scope.titulos);
          $scope.cuerpo = new Array();
          angular.forEach($scope.tablaReportes,function(valor,llave){
            $scope.cuerpo.push(Object.values(valor));
          });
          crearPDF();
          },
          (err)=>{
            console.log(err);
          });
        break;
      default:
    }
  


    function crearPDF (){
      var doc = new jsPDF("landscape","mm","a4");
      var imgData = "data:image/png;base64,";
      doc.addImage(imgData, 'PNG', 120, 0, 60, 30);
      doc.autoTable($scope.titulos, $scope.cuerpo,{margin: {top: 32}});
      doc.save('reporte.pdf');
    }

  }



}]);
